♥️Mini Série♥️

     Jazz faz uma lista de objetivos caso o mod não tenha nenhuma conquista diferente.
     Exemplos:
- Ir para o Nether;
- Não morrer mais que 3 (ou 5) vezes durante a mini série;
- Matar o Ender Dragon;

     O nome da mini série pode ser:

     Perdido na ilha!!!
